import './App.css';
import { Switch, Route, Redirect } from 'react-router-dom';

import { connect } from 'react-redux';
import { toggleMemberSignin } from "./redux/site-members/site-member.actions";

import HomePage from './pages/homepage/homepage.component';
import SigninPage from "./pages/signin/signin.component";
import RegistrationPage from "./pages/register/register.component"


function App() {

  return (
    <div className="App">
      <Switch>
        <Route exact path ='/home' component={HomePage} />
        <Route exact path ='/register' component={RegistrationPage} />
        <Route exact path ='/' render={() => memberSignedIn ? (<Redirect to='/home' />) : (<SigninPage />)} />
      </Switch>
    </div>
  );
}

const mapStateToProps = (state) => ({
  state: state
});

const mapDispatchToProps = (dispatch) => ({
  toggleMemberSignin: dispatch(toggleMemberSignin())
});

export default connect(mapStateToProps, mapDispatchToProps)(App);
